import React from 'react';
import './ChatForm.css'

export default function ChatForm({sendMessage}) {
    return(
        <div className="chat-messages">
            <div className="chat-messages-show-container">
                <ul className="chat-messages-show-list" id="message-list">
                </ul>
            </div>
            <div className="chat-messages-create-container"> 
                <input className="chat-messages-create-input" type="text" />
                <button  className="chat-messages-create-button" onClick={sendMessage} > Send </button>
            </div>
        </div>
    );
}
